pub fn get_test_asset(asset_name: &str) -> PathBuf {
    PathBuf::from(format!(
        "{}/test/assets/{}",
        env!("CARGO_MANIFEST_DIR"),
        asset_name
    ))
}

pub fn get_test_convention() -> Convention {
    Convention::new(
        get_test_registrations(),
        get_event_list(),
        get_participants_by_event(),
    )
}

